description:
In deze wervelende show in een prachtig decor met duizenden lichtjes ontdekken Karen, Kristel en Josje de wondermachine van Professor Schwarzwald. Met deze geniale uitvinding kun je worden wat je maar wilt, maar ook tijdreizen. De professor waarschuwt de meisjes dat ze niet aan de machine mogen komen, omdat hij nog niet goed werkt. De meisjes kunnen hun nieuwsgierigheid niet bedwingen en proberen hem uit... Al snel blijkt dat ze dat misschien beter niet hadden kunnen doen.

